import React, { Component } from "react";
import Leader from "../components/Leader.js";

class LeaderBoard extends Component {
  state = {};

  getLeaders = () => {
    fetch("http://localhost:3000/games#top_ten")
    .then(resp => resp.json())
  };

  render() {
    return (
      <div>
        LeaderBoard Component Here
        <Leader />
      </div>
    );
  }
}

export default LeaderBoard;
